import React, { useState } from 'react';
import './SignUp.css';

const SignUp = () => {
  const [formData, setFormData] = useState({
    fullName: '',
    email: ''
  });
  const [errors, setErrors] = useState({});

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
    // Clear error when user starts typing
    if (errors[name]) {
      setErrors(prev => ({
        ...prev,
        [name]: ''
      }));
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const newErrors = {};

    // Validation
    if (!formData.fullName) {
      newErrors.fullName = 'Full name is required';
    }

    if (!formData.email) {
      newErrors.email = 'Email is required';
    } else if (!/\S+@\S+\.\S+/.test(formData.email)) {
      newErrors.email = 'Email is invalid';
    }

    if (Object.keys(newErrors).length > 0) {
      setErrors(newErrors);
      return;
    }

    // Handle signup logic here - redirect to email verification
    console.log('Signup attempt:', formData);
    // You can add your registration logic here
    // For now, we'll just log the data
  };

  return (
    <div className="signup-page">
      <div className="signup-container">
        {/* Left Panel - Form */}
        <div className="form-panel">
          <div className="form-header">
            <h1 className="page-title">Sign up</h1>
            <div className="login-link-top">
              Already have an account? <a href="/login">Log in</a>
            </div>
          </div>

          <div className="form-content">
            <h2 className="section-title">Get Started Now</h2>

            <form className="signup-form" onSubmit={handleSubmit}>
              <div className="form-group">
                <label htmlFor="fullName">Full Name</label>
                <div className="input-container">
                  <span className="input-icon">üë§</span>
                  <input
                    type="text"
                    id="fullName"
                    name="fullName"
                    value={formData.fullName}
                    onChange={handleChange}
                    className={errors.fullName ? 'error' : ''}
                    placeholder="Enter full name"
                  />
                </div>
                {errors.fullName && <span className="error-message">{errors.fullName}</span>}
              </div>

              <div className="form-group">
                <label htmlFor="email">Email</label>
                <div className="input-container">
                  <span className="input-icon">‚úâÔ∏è</span>
                  <input
                    type="email"
                    id="email"
                    name="email"
                    value={formData.email}
                    onChange={handleChange}
                    className={errors.email ? 'error' : ''}
                    placeholder="Enter email address"
                  />
                </div>
                {errors.email && <span className="error-message">{errors.email}</span>}
              </div>

              <button type="submit" className="next-btn">
                Next
              </button>
            </form>
          </div>
        </div>

        {/* Right Panel - Cityscape Image */}
        <div className="visual-panel">
          <div className="cityscape-image">
            {/* This would be your Singapore cityscape image */}
            <div className="image-placeholder">
              <div className="cityscape-content">
                <h3>Singapore</h3>
                <p>Marina Bay Sands ‚Ä¢ Marina Bay</p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SignUp;
